script: |
  super -f tsv -I q1616.sql | sort > q1616.out

vector: true

inputs:
  - name: q1616.sql
    data: |
      SELECT col2 FROM tab2 AS cor0 WHERE - 16 NOT BETWEEN ( + + col1 * - ( col2 ) * + 84 ) AND - col0;
  - name: tab2

outputs:
  - name: q1616.out
    data: |
      23
      40
      58
